import React, { useState } from 'react';

import Header from './components/Layout/Header';
import Meals from './components/Meals';
import Cart from './components/Cart';

const App = () => {
    const [cartOpen, setCartOpen] = useState(false);

    return (
        <>
            {cartOpen ? <Cart /> : null}
            <Header />
            <Meals />
        </>
    );
};

export default App;
